// import logo from './logo.svg';
import './App.css';
import Login from './components/Login.js';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
<>
<BrowserRouter>
<Navbar/>
<div>
<Routes>
  <Route path='/Login' element={<Login/>}/>
  <Route/>
</Routes>
</div>
</BrowserRouter>
</>
  );
}

export default App;
